import countriesJson from '../countries.json';

const Selector = () => {

    return (
        <div>
            <select>
                {
                    countriesJson.map((country, index) => 
                        <option key={index = index +1} value={country.slug}>{country.Country}</option>
                    )
                }
            </select>
        </div>
    );
}

export default Selector;
